import Cover from "./Cover";

function App() {
  let Component
  switch (window.location.pathname) {
    case "/":
      Component = App
      break;
    case "/coba1":
      Component = App
      break;
    case "/coba2":
    Component = App
    break;
  }
  return (
    <div className="App">
      <Cover />
      <Component />
    </div>
  );
}

export default App;
